  false,\n\t\"url\": null,\n\t\"notes\": \"The Santa Clara Valley Water District and
  the U.S. Fish and Wildlife Service Don Edwards National Wildlife Refuge implemented
  the Island Ponds Restoration Project to fulfill two goals: 1) to initiate ecological
  restoration activities as described in the South Bay Salt Pond Initial Stewardship
  Plan (ISP), and 2) to satisfy the tidal marsh mitigation needs of both the Refuge
  for the ISP, and the District for the Stream Maintenance Program and the Lower Guadalupe
  River Project. A description of each mitigation site is provided along with an overview
  of monitoring methods and results.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
